Brand: AtlasCopco;
Time of main continuous work: 24 hours/day;
Nominal power: 5 kW;
Maximum power: 5.5 kW;
Number of phases: single-phase;
Fuel tank capacity: 25 l;
Sound pressure level (LPA) at 7m: 72dB(A)
The AtlasCopco brand is a world leader in the production of industrial equipment and generators. If you are looking for machinery that can withstand intensive operation and has service support, AtlasCopco is a well-known choice. Friendly and professional approach to your needs, giving confidence in autonomy and quality.
Gasoline single-phase generator P6500 Atlas Copco Designed for intensive daily use. The generator is copper wound and gives excellent performance combined with ease of use and transport thanks to the wheels. The handle and wheels can be assembled by any user. The unit allows you to have electricity where it is needed and meets EU noise standards. The generator has an enlarged fuel tank with a capacity of 25 liters. Equipped with an AVR board that provides automatic regulation of the output voltage, making it always perfectly constant under different load conditions. The engine is started by an electric starter from the key. It has a differential switch and an undervoltage control relay in its arsenal. Protection against operation with low oil level is installed. The sound pressure level (LPA) at a distance of 7 m is only 72 dB(A) - for comparison: Chinese generators of small power (eg 3 kW) produce a noise level of at least 92 dB, which is 25% noisier than a Swedish one! Which ensures convenient operation of both the generator and the surrounding people. There are two types of sockets, a fuel indicator, an hour meter and a voltmeter. - enlarged fuel tank - oil level sensor - overheating protection - complies with EU noise standards (sound insulation casing) - sockets - automatic voltage regulation system (AVR) - indicators: low engine oil level, engine overload - connectors and cables for parallel operation
